INSERT INTO `subject_details` VALUES (14,14,'<p>is the branch of surgery concerned with conditions involving the musculoskeletal system. Orthopaedic surgeons use both surgical and nonsurgical means to treat musculoskeletal trauma, spine diseases, sports injuries, degenerative diseases, infections, tumours, and congenital disorders.</p>','is the branch of surgery concerned with conditions involving the musculoskeletal system. Orthopaedic surgeons use both surgical and nonsurgical means to treat musculoskeletal trauma, spine diseases, sports injuries, degenerative diseases, infections, tumours, and congenital disorders.','e03c09b6f7a4a58200dbcfbc348e1ae4.jpg'),(15,15,'<p>Anaesthesiology is the medical speciality concerned with the total perioperative care of patients before, during and after surgery. It encompasses anaesthesia , intensive care medicine, critical emergency medicine and pain medicine.</p>','Anaesthesiology is the medical speciality concerned with the total perioperative care of patients before, during and after surgery. It encompasses anaesthesia , intensive care medicine, critical emergency medicine and pain medicine.','1eba358c16740c10cfc8849116ae3bfe.jpg'),(16,16,'<p>Radiology is the medical specialty that uses medical imaging to diagnose and treat diseases within the body.</p>','Radiology is the medical specialty that uses medical imaging to diagnose and treat diseases within the body.','80cc52f9528e8b529da581a73af8766d.jpg'),(17,17,'<p>Dermatology is the branch of medical science that deals with the diagnosis and treatment of skin diseases, its appendages (hair, nails) and adjoining mucous membrane (mouth, genital). Venereology is the branch of medical science that deals with the diagnosis and treatment of sexually transmitted diseases (STD) also called &quot;venereal diseases&quot;.</p>','Dermatology is the branch of medical science that deals with the diagnosis and treatment of skin diseases, its appendages (hair, nails) and adjoining mucous membrane (mouth, genital). Venereology is the branch of medical science that deals with the diagnosis and treatment of sexually transmitted diseases (STD) also called \"venereal diseases\".','d6e791bd2da3c512a60912144fa70445.jpg'),(18,18,'<p>Psychiatry is the medical specialty devoted to the diagnosis, prevention and treatment of mental disorders. These include various maladaptations related to mood, behaviour, cognition, and perceptions.</p>','Psychiatry is the medical specialty devoted to the diagnosis, prevention and treatment of mental disorders. These include various maladaptations related to mood, behaviour, cognition, and perceptions.','c686c9f3a76266eef6083a1fe9343857.jpg'),(19,19,'<p>Paediatrics is the branch of medicine that involves the medical care of infants, children, and adolescents.</p>','Paediatrics is the branch of medicine that involves the medical care of infants, children, and adolescents.','3017fc862028d5830455f962ebe802d8.jpg'),(20,20,'<p>Obstetrics and gynaecology is the medical specialty that encompasses the two subspecialties of obstetrics ( covering pregnancy, childbirth, and the postpartum period) and gynecology (covering the health of the female reproductive system &ndash; vagina, uterus, and ovaries).</p>','Obstetrics and gynaecology is the medical specialty that encompasses the two subspecialties of obstetrics ( covering pregnancy, childbirth, and the postpartum period) and gynecology (covering the health of the female reproductive system  vagina, uterus, and ovaries).','ce550384f96401cfba73163b96e8fdeb.jpg'),(21,21,'<p>Surgery is a medical specialty that uses operative manual and instrumental techniques on a patient to investigate or treat a pathological condition such as a disease or injury, to help improve bodily function or appearance or to repair unwanted ruptured areas.</p>','Surgery is a medical specialty that uses operative manual and instrumental techniques on a patient to investigate or treat a pathological condition such as a disease or injury, to help improve bodily function or appearance or to repair unwanted ruptured areas.','1a4d5b3fd008438108a666f46a09c16b.jpg'),(22,22,'<p>Medicine is the science and practice of the diagnosis, treatment, and prevention of disease. Medicine encompasses a variety of health care practices evolved to maintain and restore health by the prevention and treatment of illness.</p>','Medicine is the science and practice of the diagnosis, treatment, and prevention of disease. Medicine encompasses a variety of health care practices evolved to maintain and restore health by the prevention and treatment of illness.','817f08fabf9076ad4e6d08ec45147b83.jpg'),(23,23,'<p>Preventive and social medicine is concerned with the measures taken to prevent diseases and promote health. Preventive and social medicine is also known as community medicine or public health. Preventive and social medicine offers medical services ranging from curative to rehabilitative. Presently, it deals with the health problems of not only a single person but the entire community at large.</p>','Preventive and social medicine is concerned with the measures taken to prevent diseases and promote health. Preventive and social medicine is also known as community medicine or public health. Preventive and social medicine offers medical services ranging from curative to rehabilitative. Presently, it deals with the health problems of not only a single person but the entire community at large.','73a0c15cfbe7ca7f5c5ea4789acc1c04.jpg'),(24,24,'<p>Also known as Otorhinolaryngology . This is a surgical subspecialty within medicine that deals with conditions of the ear, nose, and throat and related structures of the head and neck.</p>','Also known as Otorhinolaryngology . This is a surgical subspecialty within medicine that deals with conditions of the ear, nose, and throat and related structures of the head and neck.','442e5635b90306227fe80f0846c1b2a0.jpg'),(25,25,'<p>Ophthalmology is a branch of medicine and surgery that deals with the diagnosis and treatment of eye disorders.</p>','Ophthalmology is a branch of medicine and surgery that deals with the diagnosis and treatment of eye disorders.','994946b8df500e616ede961791036d6b.jpg'),(26,26,'<p>FMT is the use of medicine, toxicology and other disciplines such as analytical chemistry, pharmacology and clinical chemistry to aid medical or legal investigation of death, poisoning, and drug use.</p>','FMT is the use of medicine, toxicology and other disciplines such as analytical chemistry, pharmacology and clinical chemistry to aid medical or legal investigation of death, poisoning, and drug use.','b7a9d1b016afaeb531e63531e1797c35.jpg'),(27,27,'<p>Microbiology is the study of microorganisms, those being unicellular, multicellular, or acellular. Microbiology encompasses numerous sub-disciplines including virology, parasitology, mycology and bacteriology.</p>','Microbiology is the study of microorganisms, those being unicellular, multicellular, or acellular. Microbiology encompasses numerous sub-disciplines including virology, parasitology, mycology and bacteriology.','1fec854f41f824190e41bab5e875e91c.jpg'),(28,28,'<p>Pathology is concerned mainly with the causal study of disease. The word pathology itself may be used broadly to refer to the study of disease in general, incorporating a wide range of bioscience research fields and medical practices.</p>','Pathology is concerned mainly with the causal study of disease. The word pathology itself may be used broadly to refer to the study of disease in general, incorporating a wide range of bioscience research fields and medical practices.','49d515812af76c1ee8cb8ca74cafc98f.jpg'),(29,29,'<p>Pharmacology is the branch of biology concerned with the study of drug action, where a drug can be broadly defined as any man-made, natural, or endogenous molecule which exerts a biochemical or physiological effect on the cell, tissue, organ, or organism</p>','Pharmacology is the branch of biology concerned with the study of drug action, where a drug can be broadly defined as any man-made, natural, or endogenous molecule which exerts a biochemical or physiological effect on the cell, tissue, organ, or organism','2fffcdfd579147f87e64c41e2994d334.jpg'),(30,30,'<p>Biochemistry, sometimes called biological chemistry, is the study of chemical processes within and relating to living organisms. Biochemical processes give rise to the complexity of life.</p>','Biochemistry, sometimes called biological chemistry, is the study of chemical processes within and relating to living organisms. Biochemical processes give rise to the complexity of life.','f104e70423143f0a35895d63b2a036ff.jpg'),(31,31,'<p>Physiology is the scientific study of the functions and mechanisms which work within a living system. As a sub-discipline of biology, the focus of physiology is on how organisms, organ systems, organs, cells, and biomolecules carry out the chemical and physical functions that exist in a living system.</p>','Physiology is the scientific study of the functions and mechanisms which work within a living system. As a sub-discipline of biology, the focus of physiology is on how organisms, organ systems, organs, cells, and biomolecules carry out the chemical and physical functions that exist in a living system.','2945df8e753eb388be21f9bd2c69a69d.jpg'),(34,34,'<p>Anatomy is the branch of biology concerned with the study of the structure of organisms and their parts. Anatomy is a branch of natural science which deals with the structural organization of living things. It is an old science, having its beginnings in prehistoric times.</p>','Anatomy is the branch of biology concerned with the study of the structure of organisms and their parts. Anatomy is a branch of natural science which deals with the structural organization of living things. It is an old science, having its beginnings in prehistoric times.','53e3cfca2e2d34f7c12600378cd14899.jpg'),(37,37,'<p>Medicine is the science and practice of the diagnosis, treatment, and prevention of disease. Medicine encompasses a variety of health care practices evolved to maintain and restore health by the prevention and treatment of illness.</p>','Medicine is the science and practice of the diagnosis, treatment, and prevention of disease. Medicine encompasses a variety of health care practices evolved to maintain and restore health by the prevention and treatment of illness.','3b476fdbbf81bbc9c58d351ffa4d6435.jpg');
